import React, { useState } from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';
import Hamburger from 'hamburger-react';

function Navbar() {
    const [isOpen, setOpen] = useState(false);

    const menuStyles = {
        maxHeight: isOpen ? '200px' : '0',
        overflow: 'hidden',
        transition: 'max-height 0.3s ease-in-out',
    };

    return (
        <nav className='bg-gray-800 p-4'>
            <div className='container mx-auto flex justify-between items-center'>
                <div className='hidden sm:flex space-x-4'>
                    <div><Link to="/" className='text-white'>Home</Link></div>
                    <div><Link to="/tools" className='text-white'>Mon matériel</Link></div>
                    <div><Link to="/services" className='text-white'>Services</Link></div>
                    <div><Link to="/about" className='text-white'>A propos</Link></div>
                    <div><Link to="/contact" className='text-white'>Contact</Link></div>
                </div>
                <div className='sm:hidden '> {/* Ajout de la classe 'text-center' pour centrer horizontalement */}
                    <Hamburger toggled={isOpen} toggle={setOpen} />
                    <div className='  text-center' style={menuStyles}>
                        <div><Link to="/" className='text-white block py-2'>Home</Link></div>
                        <div><Link to="/tools" className='text-white block py-2'>Mon matériel</Link></div>
                        <div><Link to="/services" className='text-white block py-2'>Services</Link></div>
                        <div><Link to="/about" className='text-white block py-2'>A propos</Link></div>
                        <div><Link to= "/contact" className="text-white block py-2">Contact</Link></div>
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
